declare  
	v_req_id 	number;   
	v_dummy_b	boolean;   
	v_phase 	varchar2(30);   
	v_status 	varchar2(30);   
	v_dev_phase	varchar2(30);   
	v_dev_status	varchar2(30);   
	v_message 	varchar2(2000);   
	v_user_id	number;  
	v_resp_id 	number;  
	v_app_id	number;  
	v_user_name	varchar2(100);  
	v_resp_name	varchar2(100);  
	v_lang		varchar2(30);  
	v_app		varchar2(50);  
	v_prog		varchar2(30);  
	v_group_id		number; 
begin   
<%if (odiRef.getOption("OA_CREATE_NEW_GROUP_ID").equals("1") || odiRef.getOption("OA_USE_EXISTING_GROUP_ID").equals("1")) 
{ 
%> 
	select GROUP_ID 
	into v_group_id 
	from <%=odiRef.getObjectName( "L" , "SNP_OA_GROUP" , "W" )%> 
	where GROUP_NAME = '<%=odiRef.getOption("OA_GROUP_ID_NAME")%>' ;
<%} else {%> 
	v_group_id = 0; 
<%}%> 
	v_user_name := '<%=odiRef.getOption("OA_USER_NAME")%>';  
	v_resp_name := '<%=odiRef.getOption("OA_RESPONSIBILITY")%>';  
	v_lang := '<%=odiRef.getOption("OA_LANGUAGE")%>';  
	v_app := '<%=odiRef.getOption("OA_APPLICATION")%>';  
	v_prog := '<%=odiRef.getOption("OA_PROGRAM")%>';  
	/* get User, Responsibility and Appp Ids ...*/  
	begin  
		select	user_id  
		into	v_user_id  
		from	applsys.fnd_user  
		where	user_name = v_user_name;  
	exception  
		when no_data_found then  
			raise_application_error (-20001, 'User ' || v_user_name ||  ' not found in fnd_user table'); 			  
	end;  

	begin  
		select 	responsibility_id,  
			application_id  
		into	v_resp_id,  
			v_app_id  
		from	applsys.fnd_responsibility_tl  
		where	responsibility_name = v_resp_name  
		and	language = v_lang;  
	exception  
		when no_data_found then  
			raise_application_error (-20001, 'Responsibility ' || v_resp_name ||  ' not found in fnd_responsibility_tl table for language ' || v_lang ); 			  
	end;  

	/* Initialize the context */  
	fnd_global.apps_initialize(v_user_id ,  v_resp_id, v_app_id);  

	/* and then submit the request */  
	v_req_id := fnd_request.submit_request(  
			application => v_app   
			,program     => v_prog  
			<%=odiRef.getOption("OA_ARGUMENTS")%>  
			);   
	/* This commit is mandatory otherwise the wait_for_request will never end */  
	commit;  
	/* check the return status */  
	if (v_req_id <= 0 or v_req_id is null) then   
     		raise_application_error (-20001, 'An error occured on cuncurrent program ' || '<%=odiRef.getUserExit("OA_PROGRAM")%>');   
	end if;  

	/* wait for the end of the request */  
	v_dummy_b := fnd_concurrent.wait_for_request (  
		request_id      => v_req_id   
		,phase           => v_phase   
		,status          => v_status   
		,dev_phase       => v_dev_phase   
		,dev_status      => v_dev_status   
		,message         => v_message);   

	if not v_dummy_b then   
		raise_application_error (-20001, 'Open Interface Error, phase : '|| v_dev_phase || ' - status : ' || v_dev_status || ' - message : ' || v_message);   
	end if;   
end;

/* This query returns a record, if the user OA_GROUP_ID_NAME does NOT exist */
