	select	'X'
	from    	<%=odiRef.getObjectName( "L" , "SNP_OA_GROUP" , "W" )%>
	where	GROUP_NAME = '<%=odiRef.getOption("OA_GROUP_ID_NAME")%>'
)
/* check only in case OA_USE_EXISTING_GROUP_ID is set */
and 	<%=odiRef.getOption("OA_USE_EXISTING_GROUP_ID")%>=1

